    false,nt"url": null,nt"notes": "In 1977, a surveillance program on Peregrine
    Falcons (Falco peregrinus anatum) was initiated on the upper Yukon River (Ambrose
    and Curatolo, 1977). The program was continued in 1978 and this paper reports on
    the results of that year's activities. The objectives of the program are: (1) To
    monitor and minimize human disturbances on the Peregrine Falcon population nesting
    along the upper Yukon River; (2) to obtain population and behavioral data pertinent
    to the management of Peregrine Falcons; and (3) to locate and identify public use
    within the study area.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
